import React from 'react';
import './Contato.css'; // Crie um arquivo CSS se necessário

function Contato() {
    return (
        <div className="contato-page">
            <h1>Contato</h1>
            <p>Conteúdo provisório para a página de contato.</p>
        </div>
    );
}

export default Contato;
